// App.js
import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Import Route instead of Switch
import ProductListPage from './pages/OrderPlacement/ProductListPage'; // Correct import path
import ProductPage from './pages/OrderPlacement/ProductPage'; // Correct import path

const App = () => {
  return (
    <Router>
      <Route exact path="/" component={ProductListPage} />
      <Route path="/product/:id" component={ProductPage} />
    </Router>
  );
};

export default App;
